idth=\"1/4\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/2\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][image_with_animation image_url=\"71\" alignment=\"right\" animation=\"Grow In\" border_radius=\"none\" box_shadow=\"none\" max_width=\"100%\"][vc_row_inner column_margin=\"default\" top_padding=\"15\" bottom_padding=\"25\" text_align=\"left\"][vc_column_inner enable_animation=\"true\" animation=\"fade-in-from-bottom\" column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" column_link_target=\"_self\" width=\"1/1\" tablet_width_inherit=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][vc_column_text]\r\n<p style=\"text-align: center;\">With 2 wheat flour wraps, meat, cheese and a sauce to finish, it’s the perfect wrap kit to grab after school or eat on the go. How do you snack it? Shred It, Peel It, Squeeeeze the Sauce!</p>\r\n<p style=\"text-align: center;\">For extra fun, Why Not, Snack it Hot? Check out an Attack A Snak pack to find out how to heat yours.</p>\r\n[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_link_target=\"_self\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/4\" tablet_width_inherit=\"default\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][/vc_column][/vc_row]','Home','','publish','closed','closed','','home-3','','','2018-09-13 13:20:57','2018-09-13 13:20:57','',0,'http://azkgwordpress1.azurewebsites.net/?page_id=101',0,'page','',0),(109,2,'2016-07-14 10:08:47','2016-07-14 10:08:47','','form_bg','Enter Redeem Code','inherit','open','closed','','form_bg','','','2016-09-26 08:45:11','2016-09-26 08:45:11','',0,'http://azkgwordpress1.azurewebsites.net/wp-content/uploads/2016/07/form_bg.png',0,'attachment','image/png',0),(110,2,'2016-07-14 10:58:50','2016-07-14 10:58:50','[vc_row type=\"full_width_content\" scene_position=\"center\" text_color=\"custom\" text_align=\"left\" overlay_strength=\"0.95\"][vc_column centered_text=\"true\" column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/1\"][nectar_slider location=\"Terms\" flexible_slider_height=\"true\" overall_style=\"classic\" slider_transition=\"slide\" button_sizing=\"regular\" slider_height=\"400\"][/vc_column][/vc_row][vc_row type=\"full_width_background\" bg_color=\"#4e81b6\" scene_position=\"center\" text_color=\"light\" text_align=\"left\" bottom_padding=\"100\" overlay_strength=\"1\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/6\"][/vc_column][vc_column column_padding=\"padding-1-percent\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"2/3\"][vc_column_text]\r\n<ol>\r\n 	<li>This Promotion is only open to residents of the United Kingdom aged 16 and over,excluding employees and the immediate families of Kerry Foods Limited (“the Promoter”) and their affiliates, distributors and subsidiaries or anyone professionally connected with this Promotion.</li>\r\n</ol>\r\n<ol start=\"2\">\r\n 	<li><strong>Promotion Period: </strong>Thison pack Promotion is live from 00.01 BST on 18<sup>th</sup> July 2016 to 23.59 BST on 25<sup>th</sup> September 2016.</li>\r\n</ol>\r\n<ol start=\"3\">\r\n 	<li><strong>Music Download Code Redemption Period</strong>: Music download codes must be redeemed between 00:01 BST on 18<sup>th</sup> July 2016 and 23:59 GMT on 31<sup>st</sup> October 2016.</li>\r\n</ol>\r\n<ol start=\"4\">\r\n 	<li>Purchase is necessary. Internet access is also required.</li>\r\n</ol>\r\n<ol start=\"5\">\r\n 	<li><strong>To Enter:</strong> Buy promotional pack of Attack ASnak and visit <a href=\"http://www.attackasnak.co.uk\">attackasnak.co.uk</a> and follow on screen instructions to click through to the Promotion page. Enter the unique code, which is found inside promotional packs plus your full name, email address and age.</li>\r\n</ol>\r\n<ol start=\"6\">\r\n 	<li>Each promotional Attack ASnak pack has a unique code which can only be used once and which entitles the purchaser to receive a code which can be used to obtain one free song redemption.</li>\r\n</ol>\r\n<ol start=\"7\">\r\n 	<li><strong>The Rewards:</strong>If you enter a valid codeyou will see, via an onscreen message and sent by email, (to the email address that you supplied at time of entry), a download code that can be used in the Universal Music Download store available at <a href=\"http://www.attackasnak-universalmusic.co.uk\">attackasnak-universalmusic.co.uk</a>.</li>\r\n</ol>\r\n<ol start=\"8\">\r\n 	<li>At the Music Download store select your favourite song from the available range, enter the download code and download the free song. No registration is needed.</li>\r\n</ol>\r\n<ol start=\"9\">\r\n 	<li>Songs will be delivered as MP3 and can be played with any MP3 compatible device.</li>\r\n</ol>\r\n<ol start=\"10\">\r\n 	<li>Downloads will be covered by the general Terms &amp; Conditions of the Universal Music Download store, see <a href=\"http://www.attackasnak-universalmusic.co.uk/GB/en/content/cms/terms-conditions\">http://www.attackasnak-universalmusic.co.uk/GB/en/content/cms/terms-conditions</a>.</li>\r\n</ol>\r\n<ol start=\"11\">\r\n 	<li>Codes have no cash value and must not be sold or exchanged.</li>\r\n</ol>\r\n<ol start=\"12\">\r\n 	<li>Specific music downloads are not guaranteed to be available for the duration of the Promotion. Options may change.</li>\r\n</ol>\r\n<ol start=\"13\">\r\n 	<li>Please allow 3 days for the delivery of the email with Download code. If you have not received your email with the Download code by this time, please check your Spam folder and Spam filter setting. If necessary please contact Kerry Customer Services at <a href=\"mailto:customercare@attackasnak.com\">customercare@attackasnak.com</a>.</li>\r\n</ol>\r\n<ol start=\"14\">\r\n 	<li>All entries must be made directly by the person entering the Promotion. Bulk entries made from trade, consumer groups or third parties will not be accepted. Incomplete or illegible entries, by or via third parties or syndicates, entries by macros or other automated means (including systems which can be programmed to enter), and entries which do not satisfy the requirements of these terms and conditions in full will be disqualified and will not be counted. If it becomes apparent that a participant is using a computer(s) to circumvent this condition by for example, the use of ‘script’, ‘brute force’, masking their identity by manipulating IP addresses, or random guessing codes or any other automated means in order to increase that participant’s entries into the Promotion in a way that is not consistent with the spirit of the Promotion, that person’s entries will be disqualified and any reward will be void.</li>\r\n 	<li>The Promoter accepts no responsibility for late, incomplete, incorrectly submitted, corrupted or misdirected entries, claims or correspondence whether due to error, omission, alteration, tampering, deletion, theft, destruction, transmission interruption, communications failure or otherwise.</li>\r\n</ol>\r\n<ol start=\"16\">\r\n 	<li>The Promoter cannot be held responsible for any third party products or services.</li>\r\n</ol>\r\n<ol start=\"17\">\r\n 	<li>The Promoter and its associated agencies and companies will not be liable for any loss (including, without limitation, indirect, special or consequential loss or loss of profits), expense or damage which is suffered or sustained (whether or not arising from any person’s negligence) in connection with this Promotion or accepting or using the offer, except for any liability which cannot be excluded by law (including personal injury, death and fraud) in which case that liability is limited to the minimum allowable by law.</li>\r\n 	<li>Any entries or codes that are deemed not to comply with these conditions of entry will be discarded.</li>\r\n</ol>\r\n<ol start=\"19\">\r\n 	<li>The Promoter will only use the personal details supplied for the administration of the Promotion and for no other purpose unless the Promoter has your consent.</li>\r\n</ol>\r\n<ol start=\"20\">\r\n 	<li>If for any reason the Promotion is not capable of running as planned for reasons (including but not limited to tampering, unauthorised intervention, fraud, technical failures or any other causes beyond the control of the Promoter which corrupt or affect the administration, security, fairness, integrity or proper conduct of this Promotion), the Promoter reserves the right (subject to any written directions given under applicable law) to disqualify any individual who tampers with the entry process and to terminate, modify or suspend the Promotion.</li>\r\n</ol>\r\n<ol start=\"21\">\r\n 	<li>If an act, omission, event or circumstance occurs which is beyond the reasonable control of the Promoter and which prevents the Promoter from complying with these terms and conditions the Promoter will not be liable for any failure to perform or delay in performing its obligation.</li>\r\n</ol>\r\n<ol start=\"22\">\r\n 	<li>By entering this Promotion, all participants will be deemed to have accepted and be bound by the terms and conditions.</li>\r\n</ol>\r\n<ol start=\"23\">\r\n 	<li>These terms and conditions are governed by English and Welsh law and shall be subject to the exclusive jurisdiction of the English and Welsh courts.</li>\r\n</ol>\r\n[/vc_column_text][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/6\"][/vc_column][/vc_row]','Terms & Conditions - Universal','','publish','closed','closed','','terms-conditions-universal','','','2018-05-17 10:58:08','2018-05-17 10:58:08','',0,'http://azkgwordpress1.azurewebsites.net/?page_id=110',0,'page','',0),(111,2,'2016-07-14 10:58:43','2016-07-14 10:58:43','','Auto Draft','','publish','closed','closed','','auto-draft-4','','','2016-07-14 10:58:43','2016-07-14 10:58:43','',0,'http://azkgwordpress1.azurewebsites.net/?post_type=nectar_slider&#038;p=111',0,'nectar_slider','',0),(112,2,'2016-07-14 10:58:36','2016-07-14 10:58:36','','terms_header','Terms and Conditions','inherit','open','closed','','terms_header','','','2016-09-26 08:50:52','2016-09-26 08:50:52','',0,'http://azkgwordpress1.azurewebsites.net/wp-content/uploads/2016/07/terms_header.jpg',0,'attachment','image/jpeg',0),(113,2,'2016-07-14 11:04:22','2016-07-14 11:04:22','[vc_row type=\"full_width_content\" scene_position=\"center\" text_color=\"custom\" text_align=\"left\" overlay_strength=\"0.95\"][vc_column centered_text=\"true\" column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/1\"][nectar_slider location=\"FAQ\" flexible_slider_height=\"true\" overall_style=\"classic\" slider_transition=\"slide\" button_sizing=\"regular\" slider_height=\"400\"][/vc_column][/vc_row][vc_row type=\"full_width_background\" bg_color=\"#4e81b6\" scene_position=\"center\" text_color=\"light\" text_align=\"left\" bottom_padding=\"100\" overlay_strength=\"1\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/6\"][/vc_column][vc_column column_padding=\"padding-1-percent\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"2/3\"][vc_column_text]<strong>What is the offer in the Promotion?</strong>\r\nIf you buy a promotional pack with a valid code you can participate in the promotion to get a free music download code from Universal, worth £ 1.09.\r\n\r\n<strong>Who can participate?</strong>\r\nThis promotion is open to everyone who has bought a Attack A Snak promotional pack in the UK, excluding employees and the immediate families of Kerry Foods (“the Promoter”) and their affiliates, distributors and subsidiaries.\r\n\r\n<strong>How do I get a promotional code for participation in the promotion?</strong>\r\nPlease buy promotional pack of Attack A Snak. Enter the valid code, which you can find inside the promotional pack plus your full name, email address and age at: <a href=\"http://www.attackasnak.com/free-music-download\">www.attackasnak.com/free-music-download</a>\r\n\r\nYou will get your music download code via e-mail. This code can be used in the Universal Music Download store available at: <a href=\"http://www.attackasnak-universalmusic.co.uk/\">www.attackasnak-universalmusic.co.uk</a>\r\n\r\n<strong>Which products are valid</strong>?\r\nThe following products with the promotional stamp are a part of the promotion:\r\n\r\nHam ‘N Cheese with Tomato Ketchup  (inc. Ham pricemarked pack), Chicken ‘N Cheese with Tomato Ketchup, Chicken ‘N Cheese with BBQ Sauce, Chicken ‘N Cheese with Peri Peri Mayo.\r\n\r\n<strong>Could I also participate without code?</strong>\r\nUnfortunately, participation without a valid code is not possible.\r\n\r\n<strong>Where can I enter my download code?</strong>\r\nPlease enter your download code, which you get via e-mail on: <a href=\"http://www.attackasnak-universalmusic.co.uk/\">www.attackasnak-universalmusic.co.uk</a>\r\n\r\n<strong>What should I consider in the download shops?</strong>\r\nAt the Music Download store select your favourite song, enter the download code and download the free song. No registration is needed. Songs will be delivered as MP3 and can be played with any MP3 compatible device.\r\n\r\n<strong>How long do I have to participate in the promotion?</strong>\r\nYou have the opportunity to participate in the promotion up until 25<sup>th</sup> September 2016 (promotional deadline).\r\n\r\n<strong>How long do I have to enter my music download code to redeem my free song?</strong>\r\nYou have the opportunity to enter your music download code, which you get via e-mail, up until 31<sup>st</sup> October 2016.\r\n\r\n<strong>How many times can I participate in the Promotion?</strong>\r\nThe number of participations per person is not restricted. Every promotional pack entitles you to one music download. You can participate as often as you wish up until 25<sup>th</sup> September. All you need is a new promotional pack with a new unique code.\r\n\r\n<strong>The download codes for the Universal Download Shop doesn’t work – what can I do?</strong>\r\nPlease double check that you have entered the complete and correct 8 digit code you received from our system via email. If the download code still isn’t accepted, please send an e-mail to Universal Music at <a href=\"mailto:support@umusic.me\">support@umusic.me</a>.\r\n\r\n<strong>My download code isn’t working at the Universal Music Store</strong>\r\nYour promotional download code is valid at <a href=\"http://www.Attackasnak-universalmusic.co.uk\">www.Attackasnak-universalmusic.co.uk</a> only and you must choose from the songs displayed at this address only. This promotion only qualifies songs with a value of £ 1.09 in our Attack A Snack Universal Music download shop It is not possible to choose songs with a value over £ 1.09.\r\n\r\n<strong>What do I do if I haven’t received a download code via e-mail?</strong>\r\nPlease be aware that it might take up to 3 days for our system to send out the email (Sender: attackasnak@reinboldrost.de.)\r\nIf you have not received your email with the Download code by this time, please check your Spam folder and Spam filter setting. If necessary, please contact Attack A Snak Customer Services at <a href=\"http://www.attackasnak.co.uk/contactus\">www.attackasnak.co.uk/contactus</a>.\r\n\r\n<strong>Can I chose songs with a value over £ 1.09?</strong>\r\nThis promotion only qualifies songs with a value of £ 1.09 in our Attack A Snack Universal Music download shop It is not possible to choose songs with a value over £ 1.09.\r\n\r\n<strong>Further questions?</strong>\r\nPlease contact our Customer Services under <a href=\"http://www.attackasnak.co.uk/contactus\">www.attackasnak.co.uk/contactus</a>  with any further questions.[/vc_column_text][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/6\"][/vc_column][/vc_row]','Frequently Asked Questions','','draft','closed','closed','','frequently-asked-questions','','','2018-04-03 14:11:28','2018-04-03 14:11:28','',0,'http://azkgwordpress1.azurewebsites.net/?page_id=113',0,'page','',0),(114,2,'2016-07-14 11:04:16','2016-07-14 11:04:16','','Auto Draft','','publish','closed','closed','','auto-draft-5','','','2016-07-14 11:04:16','2016-07-14 11:04:16','',0,'http://azkgwordpress1.azurewebsites.net/?post_type=nectar_slider&#038;p=114',0,'nectar_slider','',0),(115,2,'2016-07-14 11:04:09','2016-07-14 11:04:09','','faqs_header','Frequently Asked Questions','inherit','open','closed','','faqs_header','','','2016-09-26 08:50:51','2016-09-26 08:50:51','',0,'http://azkgwordpress1.azurewebsites.net/wp-content/uploads/2016/07/faqs_header.jpg',0,'attachment','ima