\r\n\r\nWe cannot accept responsibility for any other web site that you may access through \"the web site\". Such links are provided only for convenience and we cannot endorse or accept any responsibility for the contents or the use of any such web sites. We also disclaim any responsibility for any views which may be expressed on \"the web site\" or on any web sites which may be linked to \"the web site\".\r\n\r\n<strong>DISCLAIMER</strong>\r\n\r\nWe do our best to ensure that information on \"the web site\" is correct but we do not accept any liability whatsoever for errors or omissions. We assume no responsibility whatsoever neither for the content of \"the web site\", nor for any damage to visitors\' computers or any other equipment, due to downloading material from \"the web site\". Information on this web site is provided \"as is\" without any warranties of any kind. In no event will we be liable to any party for any damages whether direct, indirect, incidental, special, consequential or other, for any use or inability to use \"the web site\" or its contents, or of any hyperlinked web site, including, without limitation, any damages for lost profits, business interruption, loss of programs or other data, even if we are expressly advised of the possibility of such damages.\r\n\r\n<strong>INFORMATION THAT WE COLLECT FROM YOU</strong>\r\n\r\nWhen visiting this website, you may be requested to provide personal information. This kind of information is only collected if you provide such information.\r\n\r\n<strong>USE OF YOUR INFORMATION</strong>\r\n\r\nYour information will enable us to deal with any enquiries you make, administer any promotions and provide you with additional services you may have requested.\r\n\r\nWe may also use the information collected so that we can administer, support, improve and develop our web site and business.\r\n\r\nWhere you have consented, we might also use your information to let you know about our products and services that we offer which may be of interest to you, about future events and news items, as well as other marketing, advertising and promotional purposes. If you change your mind about being contacted in the future, please let us know.\r\n\r\n<strong>DISCLOSURE OF YOUR INFORMATION</strong>\r\n\r\nThe information you provide to us may be shared with staff working within Kerry Foods Limited and third parties who act for us for the purposes set out in this policy or for other purposes approved by you.\r\n\r\nIf there is any transfer outside the EEA*, Kerry Group PLC will take steps to ensure that adequate protection is in place in accordance with the requirements of the Data Protection Act 1998.\r\n\r\nUnless required to do so by law we will not otherwise share sell or distribute any of the information you provide to us without your consent.\r\n\r\n*EEA = European Economic Area\r\n\r\n<strong>USE BY CHILDREN</strong>\r\n\r\nOur site is open to users of all ages. If children under the age of 18 enter our promotions parental consent is requested.\r\n\r\n<strong>COOKIES</strong>\r\n\r\nCookies are small amounts of information that we store on your computer. Unless you have indicated your objection when disclosing your details to us, our system will issue cookies to your computer when you log on the site. Cookies make it easier for you to log on to and use the site during future visits. They also allow us to monitor website traffic and to personalise the content of the site for you. You may set up your computer to reject cookies although, in that case, you may not be able to use certain features on our site. If you do not wish to receive cookies in the future, please let us know.\r\n\r\n<strong>SECURITY AND DATA RETENTION</strong>\r\n\r\nWe employ security measures to protect your information from access by unauthorised persons and against unlawful processing, accidental loss destruction and damage. We will retain your information for a reasonable period or as long as the law requires.\r\n\r\n<strong>CHANGES TO OUR PRIVACY POLICY</strong>\r\n\r\nAny changes we may make to our privacy policy in the future will be posted on this page.\r\n\r\n<strong>CONTACT US</strong>\r\n\r\nIf you have any queries and would like to get in touch, please fill out a query form on the ‘contact us’ page of this website.[/vc_column_text][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/6\"][/vc_column][/vc_row]','Legal Stuff','','publish','closed','closed','','legal-stuff','','','2016-07-29 11:46:38','2016-07-29 11:46:38','',0,'http://azkgwordpress1.azurewebsites.net/?page_id=116',0,'page','',0),(117,2,'2016-07-14 14:30:31','2016-07-14 14:30:31','','Auto Draft','','publish','closed','closed','','auto-draft-6','','','2016-07-14 14:31:08','2016-07-14 14:31:08','',0,'http://azkgwordpress1.azurewebsites.net/?post_type=nectar_slider&#038;p=117',0,'nectar_slider','',0),(118,2,'2016-07-14 14:30:28','2016-07-14 14:30:28','','legal_stuff_header','Legal Stuff','inherit','open','closed','','legal_stuff_header','','','2016-09-26 08:50:46','2016-09-26 08:50:46','',0,'http://azkgwordpress1.azurewebsites.net/wp-content/uploads/2016/07/legal_stuff_header.jpg',0,'attachment','image/jpeg',0),(123,2,'2016-09-25 22:46:17','0000-00-00 00:00:00','[vc_row type=\"full_width_content\" scene_position=\"center\" text_color=\"dark\" text_align=\"left\" overlay_strength=\"0.3\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" width=\"1/1\"][nectar_slider location=\"Redeem\" flexible_slider_height=\"true\" overall_style=\"classic\" slider_transition=\"slide\" button_sizing=\"regular\" slider_height=\"400\"][/vc_column][/vc_row][vc_row type=\"full_width_background\" bg_color=\"#4e81b6\" scene_position=\"center\" text_color=\"light\" text_align=\"left\" overlay_strength=\"0.3\"][vc_column colu