2018-02-20 09:18:44','2018-02-20 09:18:44','[vc_row type=\"full_width_content\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"custom\" text_align=\"left\" overlay_strength=\"0.95\" shape_divider_position=\"bottom\"][vc_column centered_text=\"true\" column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][nectar_slider location=\"Terms\" flexible_slider_height=\"true\" overall_style=\"classic\" slider_transition=\"slide\" button_sizing=\"regular\" slider_height=\"400\"][/vc_column][/vc_row][vc_row type=\"full_width_background\" full_screen_row_position=\"middle\" bg_color=\"#4e81b6\" scene_position=\"center\" text_color=\"light\" text_align=\"left\" bottom_padding=\"100\" overlay_strength=\"1\" shape_divider_position=\"bottom\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/6\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][/vc_column][vc_column column_padding=\"padding-1-percent\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"2/3\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][nectar_btn size=\"large\" button_style=\"regular\" button_color_2=\"Accent-Color\" icon_family=\"none\" el_class=\"fixed-size\" url=\"http://azkgwordpress1.azurewebsites.net/half-price-entry/\" text=\"Back to the Promotion\"][vc_column_text css=\".vc_custom_1523010468018{padding-top: 1% !important;padding-bottom: 3% !important;}\"]\r\n<h2><strong>FULL TERMS AND CONDITIONS 2018</strong></h2>\r\n<strong>The Voucher entitles holder to ONE ADULT OR CHILD HALF PRICE ENTRY</strong>\r\n\r\n1. The voucher entitles the holder to ONE ADULT OR CHILD HALF PRICE ENTRY to Chessington World of Adventures Resort (“Chessington”), Madame Tussauds London or Blackpool, The London, York, Edinburgh or Blackpool Tower Dungeons, (“The Dungeons”),\r\n<strong>PLEASE NOTE:</strong> You cannot book online or over the phone when using your Voucher; in order to use the Voucher you must purchase your ticket at the Attraction entrance unless indicated in point 4 of these terms and conditions. Voucher is not valid for use in conjunction with any other offer, concession or online/call centre booking. The Voucher has no cash value. <strong>The Voucher is automatically void if sold, offered for sale or if any attempt or offer is made to transfer the Voucher for value.</strong>\r\n\r\n2. <strong>Voucher is valid UNTIL</strong> 1st November 2018 at Chessington World of Adventures and 31st December 2018 at Madame Tussauds London or Blackpool, The London, York, Edinburgh &amp; Blackpool Tower Dungeons, <strong>Voucher EXCLUDES: the following dates:</strong> 4th,5th,6th, 11th,12th,13th,, 18th, 19th, 20th,25th, 26th, 27th August and 1st, 2nd, 3rd September at Chessington World of Adventures 14th – 17th April 2018 and the 27th – 29th October 2018 at The London Dungeon, 27th – 31st October 2018 at The Blackpool Tower Dungeon, 27th – 31st October 2018 at The York and Edinburgh Dungeons, <strong>25th December 2018 and any secondary ticketed events/hotel events/concerts/Xmas events at all Attractions.</strong>\r\n\r\n3. <strong>PLEASE NOTE CERTAIN ATTRACTIONS WILL BE CLOSED ON THE FOLLOWING DATES DURING 2017</strong> WHEN GUEST VISITATION HAS HISTORICALLY BEEN VERY LOW.\r\n\r\nChessington World of Adventures Resort will be closed:\r\n<strong>24th, 25th April</strong>\r\n<strong>1st, 2nd, 8th, 9th, 15th, 16th, May</strong>\r\n<strong>11th, 12th, 18th, 19th, 25th, 26th September</strong>\r\n<strong>2nd, 3rd, 9th, 10th, 16th, 17th October</strong>\r\n\r\n<strong>THE OFFER IS VALID FROM 9th APRIL 2018 TO 1st NOVEMBER at Chessington World of Adventures Resort and 31st December at other participating attractions.</strong> Please check the attraction’s operating calendar available on its website.\r\n\r\n<strong>PLEASE NOTE THE FOLLOWING 2017 SEASON END ATTRACTION CLOSURE DATES:</strong> Chessington World of Adventures Resort closes 1st November 2018\r\n\r\n4. CHECK OPENING DATES AND TIMES BEFORE YOUR VISIT ON THE RELEVANT ATTRACTION WEBSITE. PLEASE NOTE YOU CANNOT BOOK ONLINE/VIA THE TELEPHONE WHEN USING YOUR VOUCHER <strong>ALL DATES SUBJECT TO CHANGE.</strong>\r\n\r\n5. <strong>The Voucher is not valid at Secondary Attractions including, but not limited to, LATES at The Dungeons and Madame Tussauds London.</strong> Voucher can only be used for standard entrance tickets and cannot be used for priority entrance and or Fastrack entrance at all Attractions. The Voucher is not valid for any combination tickets including, but not limited to, The Tower Ticket or The Big Ticket at The Blackpool Tower Attractions. Voucher does not entitle Early Ride Time.\r\n\r\n6. <strong>The Voucher is not valid for accommodation including but not limited to, Chessington Resort Hotel, Chessington Azteca Hotel, Chessington Explorer Glamping, an additional cost applies. Please check each attraction’s website for additional costs.</strong>\r\n\r\n7. <strong>The Voucher remains the property of Merlin at all times and Merlin reserves the right to take possession of the Voucher at any time.</strong> The Voucher must be presented at the Attraction entrance and surrendered. <strong>Vouchers cannot be presented on electronic devices.</strong>\r\n\r\n8. Adult is 12 and over at Chessington. Adult is 15 and over at Madame Tussauds Blackpool, The Blackpool Tower Dungeon. Adult is 16 and over at Madame Tussauds London, The London, York and Edinburgh Dungeons.\r\n\r\n9. Entry is free for children under 3 years of age at Chessington World of Adventures Resort, The Edinburgh and York Dungeons, Madame Tussauds London, Madame Tussuads Blackpool and The London Dungeon.\r\n\r\n10. Visitors 12 years and under must be accompanied by a person 18 years of age or over at Chessington, Visitors 15 and under must be accompanied by a person aged 16 years or over at the Edinburgh Dungeon. Visitors 14 years and under must be accompanied by an adult at the York Dungeon. Visitors aged 15 years and under must be accompanied by a person aged 18 at Madame Tussauds London, The Dungeons, Madame Tussauds Blackpool\r\n\r\n11. Voucher can only be used as stipulated. The Voucher is non-transferable/not for resale. Any purported transfer or sale of the Voucher will render it void. Voucher is only valid in the United Kingdom. Photocopies will not be accepted. Admission prices are subject to change. Voucher cannot be used in-conjunction with any other offer or concession (e.g. senior citizens, family tickets), reward/loyalty program, pre-purchased tickets, Combination tickets, 2 Day Pass, Annual Pass, online tickets, Q-bot or Fastrack tickets, rail inclusive offers, on secondary ticketed events, hotel events or concerts or for Group/advance bookings.\r\n\r\n12. <strong>Only one Voucher can be used per person and per transaction.</strong>\r\n\r\n13. All of the Attractions reserve the right, in their absolute discretion, to refuse entry and to close and/or alter all or any part of the facilities including closure of rides and/or attractions and removal of figures for technical, operational, health and safety or other reasons including over capacity. Please note The York Dungeon does not have a ride feature available.\r\n\r\n14. Features and/or creatures shown on the Voucher are not necessarily available at every Attraction. Any images shown of Madame Tussauds depict wax figures created and owned by Madame Tussauds.\r\n\r\n15. Please note that Chessington operate a chargeable car parking policy.\r\n\r\n16. Size, height, weight, age restrictions and medical warnings apply to certain rides and/or attractions.\r\n\r\n17. <strong>All attraction information is subject to change;</strong> please check the attraction websites(s) below before your visit for the latest information. Please note: you cannot book online or over the phone when using your Voucher; in order to use the Voucher you must purchase your ticket at the Attraction entrance.\r\n\r\n18. For Attraction information please <strong>visit,<a href=\"https://www.chessington.com/\">www.chessington.com</a>, <a href=\"https://www.thedungeons.com/\">www.thedungeons.com</a>, <a href=\"https://www.madametussauds.com/london/en/\">www.madametussauds.com/london</a>, <a href=\"https://www.madametussauds.com/blackpool/en/\">www.madametussauds.com/blackpool</a>, <a href=\"https://www.theblackpooltower.com/\">www.theblackpooltower.com</a></strong>\r\n\r\n19. Entry into any participating Merlin attraction will be subject to the individual attraction’s terms and conditions of entry, which can be found on the websites listed above.[/vc_column_text][nectar_btn size=\"large\" button_style=\"regular\" button_color_2=\"Accent-Color\" icon_family=\"none\" el_class=\"fixed-size\" url=\"http://azkgwordpress1.azurewebsites.net/half-price-entry/\" text=\"Back to the Promotion\"][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/6\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][/vc_column][/vc_row]','Merlin - Terms & Conditions','','publish','closed','closed','','merlin-terms-conditions','','','2018-04-06 10:27:53','2018-04-06 10:27:53','',0,'http://attackasn