aitrose_colour','','inherit','closed','closed','','waitrose_colour','','','2018-04-03 14:45:38','2018-04-03 14:45:38','',191,'http://attackasnak.com/wp-content/uploads/2018/04/waitrose_colour.png',0,'attachment','image/png',0),(202,2,'2018-04-12 09:21:03','2018-04-12 09:21:03','','iceland_colour','','inherit','closed','closed','','iceland_colour','','','2018-04-12 09:21:03','2018-04-12 09:21:03','',0,'http://attackasnak.com/wp-content/uploads/2018/04/iceland_colour.png',0,'attachment','image/png',0),(206,2,'2018-05-17 09:54:43','2018-05-17 09:54:43','','Kerry-Foods-GDPR','','inherit','closed','closed','','kerry-foods-gdpr','','','2018-05-17 09:54:43','2018-05-17 09:54:43','',0,'http://attackasnak.com/wp-content/uploads/2018/05/Kerry-Foods-GDPR.png',0,'attachment','image/png',0),(207,2,'2018-05-17 10:51:55','2018-05-17 10:51:55','[vc_row type=\"full_width_content\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"custom\" text_align=\"left\" overlay_strength=\"0.95\" shape_divider_position=\"bottom\"][vc_column centered_text=\"true\" column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][nectar_slider location=\"Privacy Policy\" flexible_slider_height=\"true\" overall_style=\"classic\" slider_transition=\"slide\" button_sizing=\"regular\" slider_height=\"400\"][/vc_column][/vc_row][vc_row type=\"full_width_background\" full_screen_row_position=\"middle\" bg_color=\"#4e81b6\" scene_position=\"center\" text_color=\"light\" text_align=\"left\" bottom_padding=\"100\" overlay_strength=\"1\" shape_divider_position=\"bottom\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/6\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][/vc_column][vc_column column_padding=\"padding-1-percent\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"2/3\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][vc_column_text]\r\n<h2 class=\"header-component\">Kerry Foods Consumer Data Protection Policy</h2>\r\n<p class=\"header-component\"><strong style=\"font-size: 16px;\">Information on who we are\r\n</strong>In Kerry Foods we are committed to protecting the privacy and security of our customers’ personal data.</p>\r\n\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nAn organisation responsible for deciding how your personal data is held and used is called a ‘data controller’ by the Data Protection legislation. Within Kerry Foods this role is fulfilled by several companies according to the product brands and/or regions.\r\n\r\nPlease identify which of the companies in the table below is the data controller of your personal data.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"table-component text-left\">\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Company Data Controller</th>\r\n<th>Region</th>\r\n<th>Product Brand</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td data-content=\"Company Data Controller\"><b>Oakhouse Foods Limited</b>,\r\nincorporated in England with a registered office address at Spinney Hill House, Sharnbrook Road, Souldrop, Bedfordshire, England MK44 1EX.</td>\r\n<td data-content=\"Region\">UK, excluding Northern Ireland</td>\r\n<td data-content=\"Product Brand\">Oakhouse Foods</td>\r\n</tr>\r\n</tbody>\r\n<tbody>\r\n<tr>\r\n<td data-content=\"Company Data Controller\"><b>Kerry Foods Limited</b>,\r\nincorporated in England with the registration number 02604258, registered at Thorpe Lea Manor, Thorpe Lea Road, Egham, Surrey TW20 8HY, United Kingdom</td>\r\n<td data-content=\"Region\">UK, including Northern Ireland</td>\r\n<td data-content=\"Product Brand\">All brands, except Oakhouse Foods</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\"Company Data Controller\"><b>Henry Denny &amp; Sons (Ireland) Limited</b>,\r\nincorporated in Ireland with the registration number 4131, registered at Prince\'s Street, Tralee, Co. Kerry, Ireland</td>\r\n<td data-content=\"Region\">Republic of Ireland</td>\r\n<td data-content=\"Product Brand\">All brands, except Oakhouse Foods</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"component-spacing\"></div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nThe companies in the table above form part of Kerry Foods division of Kerry Group plc, a public company incorporated in Ireland with a registered office address at Prince’s Street, Tralee, County Kerry, Ireland.\r\n\r\nKerry Foods websites and digital channels such as social networks are an important channel for the communication of information on our programmes and services. Kerry Foods websites and other digital channels may collect personal information about users through cookies, related software technologies and through forms that you fill in and submit to us.\r\n\r\nThis policy describes how we collect and use personal data about you.\r\n\r\nIt is important that you read this policy so that you are aware of how and why we are using your personal information.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Data Protection Officer\r\n</strong>We have appointed a Data Protection Officer to oversee compliance with this policy. If you have any questions about this policy or how we handle your personal information, please contact our Data Protection Officer by post at Kerry Global Technology &amp; Innovation Centre, Millennium Park, Naas, Co. Kildare, Ireland or by email <a href=\"mailto:data.protection@kerry.com\" target=\"_self\">data.protection@kerry.com</a>.\r\n\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>The kind of information we hold about you\r\n</strong>Personal data means any information about an individual from which that person can be identified. It does not include anonymous data i.e. data from which you cannot be identified.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nThere are special categories of more sensitive personal data which require a higher level of protection.\r\n\r\nWhen you avail of our services or purchase our products, we may collect, store, and use the following categories of personal data about you:\r\n<ul>\r\n 	<li><b>Identity Data</b> – details such as first name, last name, username or similar identifier, title, date of birth and gender.</li>\r\n 	<li><b>Contact Data</b> – name, title, addresses, telephone numbers, and business and personal email addresses.</li>\r\n 	<li><b>Profile Data</b> – your username and password, purchases or orders made by you, your interests, preferences, feedback and survey responses.</li>\r\n 	<li><b>Financial Data</b> – where you make payments to us, we will collect the IBAN, BIC and the name of your bank/building society or your credit card details where relevant.</li>\r\n 	<li><b>Transaction Data</b> – details about payments to and from you and other details of products and services you have purchased from us.</li>\r\n 	<li><b>Marketing and Communications Data</b> – data on your preferences in receiving marketing from us and our third parties and your communication preferences.</li>\r\n 	<li><b>Interaction and Usage Data</b> – when you interact with us we will record details of those interactions (for example, phone calls, e-mail correspondence and hard copy correspondence as well as information on how you use our website, products and services). If you make a complaint we will process details concerning that complaint.</li>\r\n 	<li><b>Sensitive Data</b> – in limited circumstances you may disclose to us information about your health, including any medical condition, e.g. making a product complaint.</li>\r\n 	<li><b>Technical Data</b> – such data would include internet protocol (IP) address, your login data, browser type and version, time zone setting and location, browser plug-in types and versions, operating system and platform and other technology on the devices you use to access this website.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>How is your personal information collected?\r\n</strong>We collect personal data through our interactions with you, when you avail of our services or purchase our products and when you complete our administrative forms in hard copy or on-line for our services and products.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nWe use different methods to collect data from and about you including through:\r\n<ul>\r\n 	<li><b>Direct interactions.</b> You may give us your Identity, Contact, Financial, Interaction and Usage Data by filling in forms, using our website or by corresponding with us by post, phone, email or otherwise. This includes personal data you provide when you:\r\n<ul>\r\n 	<li>order our products or services;</li>\r\n 	<li>request information or provide your feedback via our websites or other digital media;</li>\r\n 	<li>create an account on our website;</li>\r\n 	<li>subscribe to our service or publications on our websites or our accounts in social networks;</li>\r\n 	<li>request marketing to be sent to you;</li>\r\n 	<li>enter a competition, promotion or survey;</li>\r\n 	<li>provide information at consumer shows/trade shows; or</li>\r\n 	<li>contact our careline to leave us you feedback, make enquiry or complaint.</li>\r\n</ul>\r\n</li>\r\n 	<li><b>Automated technologies or interactions</b>. As you interact with our website and digital channels, we may automatically collect Technical Data about your equipment, browsing actions and patterns. We collect this personal data by using cookies, server logs and other similar technologies. <a href=\"http://azkgwordpress1.azurewebsites.net/cookie-policy/\" target=\"_self\">Please see our cookie policy</a> for further details.</li>\r\n 	<li><b>Third parties or publicly available sources</b>. We may receive personal data about you from various third parties and public sources as set out below:\r\n<ul>\r\n 	<li>Technical Data from the following parties based inside or outside the EU:\r\n<ul>\r\n 	<li>analytics providers such as Google based;</li>\r\n 	<li>advertising networks; and</li>\r\n 	<li>search information providers</li>\r\n</ul>\r\n</li>\r\n 	<li>Contact, Financial and Transaction Data from providers of technical, payment and delivery services based inside or outside the EU.</li>\r\n 	<li>Identity and Contact Data from distributors, data brokers or aggregators based inside or outside the EU.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>How we use your personal information\r\n</strong>We will only use your personal data when the law allows us to.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nWe need to process your personal data primarily to allow us to perform our contract with you and to enable us to comply with our legal obligations. In some cases we may use your personal data to pursue legitimate interests of our own or those of third parties, provided your interests and fundamental rights do not override those interests.\r\n\r\nWe may also use your personal information where we need to protect your interests (or someone else\'s interests) or where it is needed in the public interest.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"table-component text-left\">\r\n<table>\r\n<thead>\r\n<tr>\r\n<th valign=\"top\">Purpose / Activity</th>\r\n<th valign=\"top\">Possible lawful basis for processing including basis of legitimate interest</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To register you as a new customer</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">Performance of a contract with you</td>\r\n</tr>\r\n</tbody>\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To process and deliver your order for our products or services including:\r\n(a)  Manage payments, fees and charges\r\n(b)  Collect and recover money owed to us</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">(a)  Performance of a contract with you\r\n(b)  Necessary for our legitimate interests (to recover debts due to us)</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To manage our relationship with you which will include:\r\n(a)   Notifying you about changes to our terms or this policy\r\n(b)   Asking you to leave a review or take a survey</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">(a)   Performance of a contract with you\r\n(b)   Necessary to comply with a legal obligation\r\n(b)   Necessary for our legitimate interests (to keep our records updated and to study how customers use our products/services)</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To enable you to partake in a prize draw, competition or complete a survey</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">(a)   Performance of a contract with you\r\n(b)   Necessary for our legitimate interests (to recover study how customers use our products/services, to develop them and grow our business)</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To manage our relationship with you as our customer</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">Performance of a contract with you</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To administer and protect our business and website (including troubleshooting, data analysis, testing, system maintenance, support, reporting and hosting of data)</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">(a)   Necessary for our legitimate interests (for running our business provision of administration and IT services, network security, to prevent fraud and in the context of a business reorganisation or group restructuring exercise)\r\n(b)   Necessary to comply with a legal obligation</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To deliver relevant website content and advertisements to you and measure or understand the effectiveness of the advertising we serve to you</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">Necessary for our legitimate interests (to study how customers use our products/services, to develop them, to grow our business and to inform our marketing strategy)</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To market and make suggestions and recommendations to you about goods or services that may be of interest to you</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">(a)   Where you have consented to receive such marketing communications\r\n(b)   Where you have previously purchased goods or services from us\r\n(b)   Necessary for our legitimate interests (to develop our products/services and grow our business)</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To use data analytics to improve our website, products/services, marketing, customer relationships and experiences</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">Necessary for our legitimate interests (to define types of customers for our products and services, to keep our website updated and relevant, to develop our business and to inform our marketing strategy)</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Purpose / Activity\">To respond to your enquiry, feedback or complaint.</td>\r\n<td valign=\"top\" data-content=\"Possible lawful basis for processing including basis of legitimate interest\">(a)   Necessary to comply with a legal obligation\r\n(b)   Performance of a contract with you</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"component-spacing\"></div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>If you fail to provide personal information\r\n</strong>If you fail to provide certain data when requested, we may not be able to enter into or perform our contract with you or provide you with our services.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nWhere we require your personal data to enter into a contract and to provide you with our services, we will make this clear.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Change of purpose\r\n</strong>If we need to use your personal data for an unrelated purpose, we will notify you and we will explain the legal basis which allows us to do so unless this is otherwise required or permitted by law (in which case we may process your personal data without your knowledge or consent).\r\n\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>How we use particularly sensitive personal information\r\n</strong>Special categories of particularly sensitive personal data require higher levels of protection.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nWe may process special categories of personal data where we need to carry out our legal obligations or where it is needed in the public interest.\r\n\r\nLess commonly, we may process this type of data where it is needed in relation to legal claims or where it is needed to protect your interests (or someone else\'s interests) and you are not capable of giving your consent, or where you have already made the information public.\r\n\r\nWe will use information about your physical or mental health, or disability status, to ensure your health and safety when you are availing of our services and to ensure that we comply with the Equal Status Acts.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Automated decision-making\r\n</strong>Automated decision-making takes place when an electronic system uses personal information to make a decision without human intervention.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nYou will not be subject to decisions that will have a significant impact on you based solely on automated decision-making, unless we have a lawful basis for doing so and we have notified you.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Marketing\r\n</strong>We may contact you by mail, email and telephone and social media about our products and services and other events which might be of interest to you.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nYou may receive marketing communications from us if:\r\n<ul>\r\n 	<li>you have requested to receive or consented to the receipt of information from us; or</li>\r\n 	<li>purchased goods or services from us (and our marketing communications will only be in relation to similar goods or services); or</li>\r\n 	<li>it is in our legitimate interest,</li>\r\n</ul>\r\nand, in each case, you have not opted out of receiving the marketing communications.\r\n\r\nYou will only receive electronic marketing communications under (b)   above where such products or services were purchased within the 12 months prior to the receipt of the communication.\r\n\r\nYou have the right to ask us to stop processing your personal data for direct marketing purposes. If you wish to exercise this right, please send us an email to <a href=\"mailto:marketing@kerryfoods.ie\" target=\"_self\">marketing@kerryfoods.ie</a>.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Data sharing\r\n</strong>We will share your personal data with third parties where required by law, where it is necessary to perform our contract with you or where we have another legitimate interest in doing so.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nWe will share your data with trusted third-party service providers. We may also share your personal data with other third parties, for example, in the context of a transfer of our statutory functions or with a regulator or to otherwise comply with the law.\r\n\r\nWe require third parties to respect the security of your data and to treat it in accordance with the law.\r\n\r\nAll our third-party service providers are required to take appropriate security measures to protect your personal data. We do not allow our third-party service providers to use your personal data for their own purposes. We only permit them to process your personal data for specified purposes and in accordance with our instructions.\r\n\r\nWe have put in place appropriate security measures to prevent your personal data from being accidentally lost, used or accessed in an unauthorised way, altered or disclosed. In addition, we limit access to your personal data to those employees, agents, contractors and other third parties who have a business need to know. They will only process your personal data on our instructions and they are subject to a duty of confidentiality.\r\n\r\nWe have also put in place procedures to deal with any suspected data security breach and will notify you and any applicable regulator of a suspected breach where we are legally required to do so.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Transferring information outside the EU\r\n</strong>We may transfer the personal data we collect about you outside the European Economic Area (EEA) where a trusted service provider is based outside of the EEA. We will always take steps to ensure that any transfer of your information outside of the EEA is carefully managed to protect your privacy rights.\r\n\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Data retention\r\n</strong>We will only retain your personal data for as long as necessary to fulfil the purposes we collected it for, including for the purposes of satisfying any legal, accounting, or reporting requirements.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nIn some circumstances we may anonymise your personal information so that it can no longer be associated with you, in which case we may use such information without further notice to you.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Rights of access, correction, erasure, and restriction</strong>\r\n\r\n<strong>Your duty to inform us of changes</strong>\r\nIt is important that the personal information we hold about you is accurate and current. Please keep us informed if your personal information changes.\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n\r\nYour rights in connection with personal information\r\n\r\nUnder certain circumstances, by law you have the right to:\r\n<ul>\r\n 	<li>Request access to your personal information.</li>\r\n 	<li>Request correction of the personal information that we hold about you.</li>\r\n 	<li>Request erasure of your personal information.</li>\r\n 	<li>Object to processing of your personal information.</li>\r\n 	<li>Request the restriction of processing of your personal information.</li>\r\n 	<li>Request the transfer of your personal information to another party.</li>\r\n</ul>\r\nIf you want to review, verify, correct or request erasure of your personal information, object to the processing of your personal data, or request that we transfer a copy of your personal information to another party, please contact our Data Protection Officer whose contact details were provided above.\r\n\r\nYou will not have to pay a fee to access your personal information (or to exercise any of the other rights). However, we may charge a reasonable fee if your request for access is clearly unfounded or excessive. Alternatively, we may refuse to comply with the request in such circumstances.\r\n\r\nWe may need to request specific information from you to help us confirm your identity and ensure your right to access the information (or to exercise any of your other rights). This is another appropriate security measure to ensure that personal information is not disclosed to any person who has no right to receive it.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Right to withdraw consent\r\n</strong>In the limited circumstances where you may have provided your consent to the collection, processing and transfer of your personal information for a specific purpose, you have the right to withdraw your consent for that specific processing at any time. To withdraw your consent, please contact our Data Protection Officer whose contact details were provided above. Once we have received notification that you have withdrawn your consent, we will no longer process your information for the purpose or purposes you originally agreed to, unless we have another legitimate basis for doing so in law.\r\n\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Complaints\r\n</strong>If you feel that we are not processing your personal data in a way in which you agree or if you feel we have acted counter to your rights then you have the right to lodge a complaint with the relevant National Supervisory Authority in your country:\r\n\r\n</div>\r\n</div>\r\n<div class=\"table-component text-left\">\r\n<table>\r\n<thead>\r\n<tr>\r\n<th valign=\"top\">Republic of Ireland</th>\r\n<th valign=\"top\">UK Head Office*</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Republic of Ireland\"><b>Data Protection Commission</b>\r\nCanal House\r\nStation Road,\r\nPortarlington,\r\nR32 AP23,\r\nCo. Laois,\r\nIreland</td>\r\n<td valign=\"top\" data-content=\"UK Head Office*\"><b>Information Commissioner\'s Office</b>\r\nWycliffe House\r\nWater Lane,\r\nWilmslow,\r\nCheshire,\r\nSK9 5AF,\r\nUK</td>\r\n</tr>\r\n</tbody>\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" data-content=\"Republic of Ireland\"><b>Tel:</b> +353 (0)57 8684800 | +353 (0)761 104 800\r\n<b>Lo Call Number:</b> 1890 252 231\r\n<b>Email:</b> <a href=\"mailto:info@dataprotection.ie\" target=\"_self\">info@dataprotection.ie</a>\r\n<b>Website:</b> <a href=\"https://www.dataprotection.ie/\" target=\"_blank\" rel=\"noopener\">www.dataprotection.ie</a></td>\r\n<td valign=\"top\" data-content=\"UK Head Office*\"><b>Tel:</b> +44 (0)303 123 1113 (local rate) | +44 (0)1625 545 745\r\n<b>Email:</b> <a href=\"mailto:dataprotectionfee@ico.org.uk\" target=\"_self\">dataprotectionfee@ico.org.uk</a>\r\n<b>Website:</b> <a href=\"http://www.ico.org.uk/\" target=\"_blank\" rel=\"noopener\">http://www.ico.org.uk</a></td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\" data-content=\"Republic of Ireland\">* Details of ICO’s regional offices in Northern Ireland, Scotland and Wales are available at <a href=\"http://www.ico.org.uk/global/contact-us/postal-addresses/\" target=\"_blank\" rel=\"noopener\">www.ico.org.uk/global/contact-us/postal-addresses/</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"component-spacing\"></div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n\r\n<strong>Changes to this policy\r\n</strong>We reserve the right to update this policy at any time. We may also notify you in other ways from time to time about the processing of your personal information.\r\n\r\n</div>\r\n</div>\r\n[/vc_column_text][/vc_column][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/6\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][/vc_column][/vc_row]','Privacy Policy','','publish','closed','closed','','privacy-policy','','','2018-07-25 12:37:26','2018-07-25 12:37:26','',0,'http://attackasnak.com/?page_id=207',0,'page','',0),(208,2,'2018-05-17 10:51:52','2018-05-17 10:51:52','','Auto Draft','','publish','closed','closed','','auto-draft-6-2','','','2018-05-17 10:51:52','2018-05-17 10:51:52','',0,'http://attackasnak.com/?post_type=nectar_slider&#038;p=208',0,'nectar_slider','',0),(209,2,'2018-05-17 10:51:32','2018-05-17 10:51:32','','cookie_policy_header','','inherit','closed','closed','','cookie_policy_header','','','2018-05-17 10:51:32','2018-05-17 10:51:32','',0,'http://attackasnak.com/wp-content/uploads/2018/05/cookie_policy_header.jpg',0,'attachment','image/jpeg',0),(210,2,'2018-05-17 10:51:34','2018-05-17 10:51:34','','privacy_policy_header','','inherit','closed','closed','','privacy_policy_header','','','2018-05-17 10:51:34','2018-05-17 10:51:34','',0,'http://attackasnak.com/wp-content/uploads/2018/05/privacy_policy_header.jpg',0,'attachment','image/jpeg',0),(211,2,'2018-05-17 10:53:26','2018-05-17 10:53:26','','Auto Draft','','publish','closed','closed','','auto-draft-6-2-2','','','2018-05-17 10:53:26','2018-05-17 10:53:26','',0,'http://attackasnak.com/?post_type=nectar_slider&#038;p=211',0,'nectar_slider','',0),(213,2,'2018-05-17 10:55:09','2018-05-17 10:55:09','[vc_row type=\"full_width_content\" full_screen_row_position=\"middle\" scene_position=\"center\" text_color=\"custom\" text_align=\"left\" overlay_strength=\"0.95\" shape_divider_position=\"bottom\"][vc_column centered_text=\"true\" column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/1\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][nectar_slider location=\"Cookie Policy\" flexible_slider_height=\"true\" overall_style=\"classic\" slider_transition=\"slide\" button_sizing=\"regular\" slider_height=\"400\"][/vc_column][/vc_row][vc_row type=\"full_width_background\" full_screen_row_position=\"middle\" bg_color=\"#4e81b6\" scene_position=\"center\" text_color=\"light\" text_align=\"left\" bottom_padding=\"100\" overlay_strength=\"1\" shape_divider_position=\"bottom\"][vc_column column_padding=\"no-extra-padding\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"1/6\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][/vc_column][vc_column column_padding=\"padding-1-percent\" column_padding_position=\"all\" background_color_opacity=\"1\" background_hover_color_opacity=\"1\" column_shadow=\"none\" column_border_radius=\"none\" width=\"2/3\" tablet_text_alignment=\"default\" phone_text_alignment=\"default\" column_border_width=\"none\" column_border_style=\"solid\"][vc_column_text]A cookie is a small file which asks permission to be placed onto your computer\'s hard drive. Once you agree, the file is added and the cookie helps examine web traffic or lets you know when you visit a site.\r\n\r\nEssentially, cookies allow web applications to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences.\r\n\r\nOverall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful and which you do not. A cookie does NOT give us access to your computer or any information about you, other than the data you choose to share with us.\r\n\r\nYou can choose to accept or decline cookies. Although most web browsers automatically accept cookies, you can usually modify your browser setting to decline cookies to your preference. However, this may prevent you from taking full advantage of our website.\r\n\r\nWe use cookies on our website and we assume you are ok with this otherwise please disable cookies in your browser or navigate away and clear cookies set by the website.\r\n\r\nCookies on this website are used for:\r\n<ol>\r\n 	<li>Analytical/performance purposes – this allows us to recognise and calculate the number of visitors and to see how visitors navigate around the website when they are using it. Therefore, helping us improve the way our website functionality for example, by ensuring that users can find what they are looking for easily.</li>\r\n 	<li>Functionality purposes – to help us recognise you when you return to our website. This allows us to personalise our content for you and remember your preferences and settings.</li>\r\n 	<li>Sharing purposes – this allows you to share pages with social networks such as Facebook and Twitter.</li>\r\n</ol>\r\n<div class=\"row\">\r\n<div class=\"large-12 columns\">\r\n<div class=\"float\">\r\n<div class=\"body\">\r\n<h3>Examples of cookies used on this website</h3>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"table-component text-left\">\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Name</th>\r\n<th>Duration</th>\r\n<th>Purpose</th>\r\n<th>Site</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td data-content=\" Name 			\">_ga</td>\r\n<td data-content=\" Duration 			\">2 years</td>\r\n<td data-content=\" Purpose 			\">Registers a unique ID that is used to generate statistical data on how the visitor uses the website</td>\r\n<td data-content=\" Site 			\">All</td>\r\n</tr>\r\n</tbody>\r\n<tbody>\r\n<tr>\r\n<td data-content=\" Name 			\">_gat</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Used by Google Analytics to throttle request rate</td>\r\n<td data-content=\" Site 			\">All</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">_git</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Registers a unique ID that is used to generate statistical data on how the visitor uses the website</td>\r\n<td data-content=\" Site 			\">All</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">JSESSIONID</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Preserves users states across page requests</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">_utm_gif</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Google Analytics Tracking Code that logs details about the visitor’s browser and computer</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">_utma</td>\r\n<td data-content=\" Duration 			\">2 years</td>\r\n<td data-content=\" Purpose 			\">Collects data on the number of times a user has visited the website as well as dates for the first and most recent visit. Used by Google Analytics</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDeliexperts.ie</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">_utmb\r\n\r\n_utmc</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Registers a timestamp with the exact time of when the user accessed the website. Used by Google Analytics to calculate the duration of a website visit</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDeliexperts.ie</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">_utmt</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Used to throttle the speed of requests to the server</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDeliexperts.ie</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">_utmz</td>\r\n<td data-content=\" Duration 			\">6 months</td>\r\n<td data-content=\" Purpose 			\">Collects data on where the user came from, what search engine was used, what link was clicked, and what search term was used. Used by Google Analytics</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDeliexperts.ie</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">vuid</td>\r\n<td data-content=\" Duration 			\">2 years</td>\r\n<td data-content=\" Purpose 			\">Collects data on the user’s visit to the website, such as which pages have been read</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">fr</td>\r\n<td data-content=\" Duration 			\">3 months\r\n\r\n&nbsp;</td>\r\n<td data-content=\" Purpose 			\">Used by Facebook to deliver a series of advertisement products such as real-time bidding from third party advertisers</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDenny.ie</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">GPS</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Registers a unique ID on mobile devices to enable tracking based on geographical GPS location</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDenny.ie\r\n\r\nIlovecitykitchen.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">impression.php/#</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Used by Facebook to register impressions on pages with the Facebook login button</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">uid</td>\r\n<td data-content=\" Duration 			\">179 days</td>\r\n<td data-content=\" Purpose 			\">Collect anonymous data related to the user’s visits to the website, such as the number of visits, average time spent on the website, and what pages have been loaded, with the purpose of displaying targeted ads</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">VISITOR_INFO1_LIVE</td>\r\n<td data-content=\" Duration 			\">179 days</td>\r\n<td data-content=\" Purpose 			\">Tries to estimate the users’ bandwidth on pages with integrated YouTube videos</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDenny.ie\r\n\r\nIlovecitykitchen.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">YSC</td>\r\n<td data-content=\" Duration 			\">End of browsing session</td>\r\n<td data-content=\" Purpose 			\">Registers a unique ID to keep statistics of what videos from YouTube the user has seen</td>\r\n<td data-content=\" Site 			\">Mattessons.co.uk\r\n\r\nDenny.ie\r\n\r\nIlovecitykitchen.co.uk</td>\r\n</tr>\r\n<tr>\r\n<td data-content=\" Name 			\">_atuvc</td>\r\n<td data-content=\" Duration 			\">13 months</td>\r\n<td data-content=\" Purpose 			\">Updates the counter of a webs